window.bookSummaryJSON = "<p>Sam Gribley is terribly unhappy living in New York City with his family, so he runs away to the Catskill Mountains to live in the woods - all by himself. With only a penknife, a ball of cord, 40 dollars, and some flint and steel, he intends to survive on his own. Sam learns about courage, danger, and independence during his year in the wilderness, a year that changes his life forever. </p>"; 
